import fetch from "node-fetch"

export default function getDeviceData() {
  fetch('http://localhost:5000/devices')
    .then(response => response.text())
    .then(data => {return getData(JSON.parse(data))})
    .catch(reject => console.log(reject))
}

function getData(data) {
  let profileList = []

  data.forEach((profile, i) => {
    profileList.push([
      {
        type: "mac",
        index: "MAC Address",
        data: (() => {
          try {return profile['data']['name'].toUpperCase()}
          catch {return ""}
        })()
      },
      {
        type: "product",
        index: "Product",
        data: (() => {
          try {profile['data']['product']}
          catch {return ""}
        })()
      },
      {
        type: "user",
        index: "User ID",
        data: (() => {
          try {return profile['data']['ownerUserName']}
          catch {return ""}
        })()
      },
      {
        type: "description",
        index: "Description",
        data: (() => {
          try {return profile['data']['description']}
          catch {return ""}
        })()
      },
      {
        type: "primary",
        index: "Primary Line",
        data: (() => {
          try {return profile['data']['lines']['line'][0]['dirn']['pattern']}
          catch {return ""}
        })()
      },
      {
        type: "mask",
        index: "E164 Mask",
        data: (() => {
          try {profile['lines']['line'][0]['e164Mask']}
          catch {return ""}
        })()
      },
      {
        type: "location",
        index: "Location",
        data: (() => {
          try {return profile['meta']['hierarchy']}
          catch {return ""}
        })()
      }
    ])
  })

  return profileList
}
